import React, { Component } from 'react';
import pokemons from './data';

class Pokedex extends Component {
  render() {
    return <div className='div-pokedex'>
      {pokemons.map((pokemon) => <div className='div-pokemon'>
        {pokemon}
      </div>)}
    </div>
  }
}

export default Pokedex;
